    const makeSingle = (e) => {
      console.log('Make grid: ', e);
    }
    return (
      <div>
        <p>{ this.props.hej }</p>
        <button onClick={ makeGrid }>Grid view</button>
        <button onClick={ makeSingle }>Single view</button>
      </div>
    )
  }
}
const Hej = props = <h1></h1>
export default ToggleView;
